"""Lagoon token checker test"""

import os
from decimal import Decimal
from pprint import pprint

import pandas as pd
import pytest
import tabulate

from eth_typing import HexAddress

from eth_defi.lagoon.lagoon_compatibility import check_lagoon_compatibility_with_database
from eth_defi.provider.multi_provider import create_multi_provider_web3
from eth_defi.trade import TradeSuccess
from eth_defi.utils import addr

JSON_RPC_BINANCE = os.environ.get("JSON_RPC_BINANCE", None)
pytestmark = pytest.mark.skipif(not JSON_RPC_BINANCE, reason="JSON_RPC_BINANCE not set, skipping BNB smart chain tests")


@pytest.fixture()
def token_list(web3) -> list[list[HexAddress]]:
    """List of different tokens to test token compatibility."""
    return list(TEST_ROUTES_DATA.values())


def test_token_compat_single(token_list, tmp_path):
    """Check single token compatibility with Lagoon."""
    database_file = tmp_path / "test_lagoon_compat.pickle"
    web3 = create_multi_provider_web3(JSON_RPC_BINANCE)

    # For the beta deployment
    compat_db = check_lagoon_compatibility_with_database(
        web3=web3,
        paths=token_list[0:1],
        vault_address=addr("0x21DA913BA04D67af88E9F709022416834AaD8F54"),
        trading_strategy_module_address=addr("0x2Cd65deeb9a2Ef11fbB0a80c0Ffaf9B0C39bf959"),
        asset_manager_address=addr("0xc9EDbb9F5b3f55B7Cc87a8Af6A695f18200E47Af"),
        database_file=database_file,
        fork_block_number=58_240_350,
    )

    report = next(iter(compat_db.report_by_token.values()))

    # Check details are filled correctly for a single token/route
    assert report.created_at is not None
    assert report.cached is False
    assert report.tokens == ["USDT", "FIST"]
    assert report.buy_block_number == 58_240_351
    assert report.sell_block_number == 58_240_353
    assert isinstance(report.buy_result, TradeSuccess), f"Trade reverted: {report.buy_result.revert_reason}"
    assert report.buy_result.price == pytest.approx(Decimal("1.395554"))

    assert report.buy_real_received == 1395554
    assert report.estimate_buy_received == 1394855

    assert report.sell_result.amount_in == 1395554
    assert report.sell_result.amount_out == 995005869237675427  # Round tripped 50 bips
    assert report.get_round_trip_cost() == pytest.approx(0.004994130762324573)

    # Check we can calculate overall tstats
    stats = compat_db.calculate_stats()
    assert stats["compatible"] == 1

    # Check caching
    compat_db = check_lagoon_compatibility_with_database(
        web3=web3,
        paths=token_list[0:1],
        vault_address=addr("0x21DA913BA04D67af88E9F709022416834AaD8F54"),
        trading_strategy_module_address=addr("0x2Cd65deeb9a2Ef11fbB0a80c0Ffaf9B0C39bf959"),
        asset_manager_address=addr("0xc9EDbb9F5b3f55B7Cc87a8Af6A695f18200E47Af"),
        database_file=database_file,
        fork_block_number=58_240_350,
    )
    report = next(iter(compat_db.report_by_token.values()))
    assert report.cached

    table = compat_db.get_diagnostics()
    assert isinstance(table, list)


@pytest.mark.skipif(os.environ.get("LONG_MANUAL_TEST") is None, reason="Long test designed for manual running")
def test_token_compat_full(token_list, tmp_path):
    """Check BNB Chain compatibility for dozens of tokens.

    - Extremely slow test

    To run:

    .. code-block:: shell

        LONG_MANUAL_TEST=true pytest --log-cli-level=info -k test_token_compat_full

    Database is stored at::

         rm ~/.tradingstrategy/token-checks/lagoon_token_check.pickle


    """
    web3 = create_multi_provider_web3(JSON_RPC_BINANCE)

    # For the beta deployment
    compat_db = check_lagoon_compatibility_with_database(
        web3=web3,
        paths=token_list,
        vault_address=addr("0x21DA913BA04D67af88E9F709022416834AaD8F54"),
        trading_strategy_module_address=addr("0x2Cd65deeb9a2Ef11fbB0a80c0Ffaf9B0C39bf959"),
        asset_manager_address=addr("0xc9EDbb9F5b3f55B7Cc87a8Af6A695f18200E47Af"),
        fork_block_number=57_446_737,
    )
    stats = compat_db.calculate_stats()
    pprint(stats)

    diagnostics = compat_db.get_diagnostics()
    df = pd.DataFrame(diagnostics)
    df = df.sort_values(by=["compatible", "base"])

    df = df.round(4)
    output = tabulate.tabulate(df, headers="keys", tablefmt="fancy_grid")
    print(output)


